const bentleyCar = {
    brand: 'Bentley',
    model: 'Continental',
    yearOfProduction: 2020,
    placeOfBeing: 'London',
    honking: false,
    speed: 0,
    engineWorks: false,
    drive: function (placeOfDestination) {
        this.placeOfBeing = placeOfDestination;
    },
    honk: function () {
        this.honking = true;
    },
    engineStart: function () {
        this.engineWorks = true;
    },
    engineStop: function () {
        this.engineWorks = false;
    }
};

document.getElementById('car-object').innerHTML = JSON.stringify(bentleyCar, undefined, 2);

function move(toPlace) {
    bentleyCar.drive(toPlace);
    document.getElementById('car-object').innerHTML = JSON.stringify(bentleyCar, undefined, 2);
}

